import React from "react";
import { Row, Button, Typography } from "antd";
import { useRouter } from "next/router";
import { useSelector } from "react-redux";
const { Text } = Typography;

import calculator from "../back/calculator";

const End = () => {
	const { ans } = useSelector((state) => state.answer);
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	return (
		<>
			<Row>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "30px",
						fontSize: "20px",
					}}
				>
					개발용으로 만든 임시 페이지.
				</Text>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "30px",
						fontSize: "20px",
					}}
				>
					나중에 type별로 페이지 각각 만들것.
				</Text>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "30px",
						fontSize: "20px",
					}}
				>
					결과: {calculator(ans)}
				</Text>
			</Row>

			<Row>
				<Button style={{ display: "block" }} onClick={toTop}>
					처음으로
				</Button>
			</Row>
		</>
	);
};

export default End;
